import { createRouter, createWebHistory } from 'vue-router'
import BodyView from "@/layout/BodyView.vue"
import indexDashbord from "@/pages/indexDashbord.vue"
import Sesion from "@/pages/sesionVue.vue"

import login from "@/auth/login.vue"
import Register from "../components/register.vue"
import registerBusi from "../components/registerBusi.vue"
import ForgetPassword from "../components/forgetpassword.vue"

import indexBusines from "@/pages/indexBusines.vue"
import indexPet from "@/pages/indexPet.vue"

import userEdit from "@/pages/user/userEdit.vue"
import adminEdit from "@/pages/admin/adminEdit.vue"

const routes = [
 {
  path:"/",
  component:BodyView,
  children:[
    {

      path:"",
      name:"dashboard",
      component:indexDashbord,
      meta: {
       title: 'Tivo Starter-kit - Premium Vue User Template',
     }
    }

  ]
},
{
 path:"/admin",
 component:BodyView,
 children:[
   {
     path:'/indexBusines',
     name:'indexBusines ',
     component:indexBusines,
     meta: {
       title: 'Tivo Starter-kit - Premium Vue Admin Template',
     }
    }
   ]
   },
   {
     path:"/user",
     component:BodyView,
     children:[
       {
         path:'/indexPet',
         name:'indexPet ',
         component:indexPet,
         meta: {
           title: 'Tivo Starter-kit - Premium Vue Admin Template',
         }
        }
       ]
       },
   {
     path:"/edit",
     component:BodyView,
     children:[
       {
           //este perfil pertenece a administrador
           path:'/admin/adminEdit',
           name:'adminEdit ',
           component:adminEdit 
         },
         {
            //este perfil pertenece a usuario
           path:'/user/userEdit',
           name:'userEdit',
           component:userEdit
         },
       ]
   },


  {
    path: '/auth/registerBusi',
    name: 'registerBusi',
    component: registerBusi
  },

  {
    path: '/Sesion',
    name: 'Sesion',
    component: Sesion
  },
  {
    path: '/components/forgetpassword',
    name: 'ForgetPassword',
    component: ForgetPassword
  },
  {
    path: '/auth/register',
    name: 'Register',
    component: Register
  },
  {
    path:"/auth/login",
    name:"login",
    component:login,
    meta:{
      title:'login-Tivo Starter-kit'
    }
  },

  ]



const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
});

router.beforeEach((to,) => {
  if (typeof (to.meta.title) === 'string') {
    document.title = to.meta.title;
  }

  });

export default router
